commit_message:
fix(position): Invalid column of the element, positioned before the first line separator (#2409) Hi! I've found that spoon gives incorrect column number for the element, positioned before the first line separator in file.

Consider the following file (TestSimpleClass.java):
```
public class TestSimpleClass {
    public int x;
    public int y;
    public int z;
}
```
If you try to get column from postion of this class, you will get -69, which is incorrect.
So, this PR is intended to fix that.

specifies and implements the natural remove operation for (CtStatement s : body) {
  body.removeStatement(s);
}

assertEquals(0,body.getStatements().size());

refactors CtCase: now extends CtStatementList one can thus write:
for (CtStatement s : case) {
 l.add(s);
}

refactors CtBlock: now extends CtStatementList one can thus write:
for (CtStatement s : block) {
  l.add(s);
}

fix generic extended type signature for methods void <T extends Throwable> toto();
void <T extends Object> toto();

